import { ScrollView, StyleSheet, Text, View } from "react-native";
import React, { useState } from "react";
import { Button, TextInput } from "@react-native-material/core";
import { cartState, setCartState } from "state/state";
import { Switch } from "react-native-gesture-handler";
import MaterialCommunityIcons from "@expo/vector-icons/MaterialCommunityIcons";

const DeliveryScreen = ({
  setDeliveryModal,
  setOngoingDelivery,
  setName,
  setPhone,
  setAddress,
  name,
  phone,
  address,
  deliveryChecked,
  setDeliveryChecked,
}) => {
  return (
    <View
      style={{
        backgroundColor: "rgba(0, 0, 0, 0.3)",
        justifyContent: "center",
        alignItems: "center",
        height: "100%",
        width: "100%",
      }}
    >
      <View style={styles.modalContainer}>
        <Text
          style={{
            textAlign: "center",
            fontSize: 22,
            fontWeight: "600",
            color: "rgba(74,74,74,1)",
            marginBottom: 20,
          }}
        >
          Create Phone Order
        </Text>
        <View
          style={{
            flexDirection: "row",
            alignItems: "center",
            backgroundColor: "rgba(243,243,243,1)",
            borderRadius: 30,
            height: 60,
            marginBottom: 25,
          }}
        >
          <View
            style={{
              width: 60,
              alignItems: "center",
              justifyContent: "center",
              backgroundColor: "rgba(218,216,216,1)",
              borderRadius: 30,
              height: 60,
            }}
          >
            <MaterialCommunityIcons
              name="account"
              size={32}
              color="rgba(71,106,229,1)"
            />
          </View>
          <TextInput
            placeholder="Enter name"
            style={{ width: "80%" }}
            inputStyle={{ backgroundColor: "rgba(243,243,243,1)" }}
            value={name}
            onChangeText={(val) => setName(val)}
            autoCorrect={false}
            textContentType={"name"}
          />
        </View>
        <View
          style={{
            flexDirection: "row",
            alignItems: "center",
            backgroundColor: "rgba(243,243,243,1)",
            borderRadius: 30,
            height: 60,
            marginBottom: 25,
          }}
        >
          <View
            style={{
              width: 60,
              alignItems: "center",
              justifyContent: "center",
              backgroundColor: "rgba(218,216,216,1)",
              borderRadius: 30,
              height: 60,
            }}
          >
            <MaterialCommunityIcons
              name="phone"
              size={32}
              color="rgba(74,74,74,1)"
            />
          </View>
          <TextInput
            placeholder="Enter Phone #"
            style={{ width: "80%" }}
            inputStyle={{ backgroundColor: "rgba(243,243,243,1)" }}
            value={phone}
            onChangeText={(val) => setPhone(val)}
          />
        </View>
        {deliveryChecked && (
          <View
            style={{
              flexDirection: "row",
              alignItems: "center",
              backgroundColor: "rgba(243,243,243,1)",
              borderRadius: 30,
              height: 60,
              marginBottom: 25,
            }}
          >
            <View
              style={{
                width: 60,
                alignItems: "center",
                justifyContent: "center",
                backgroundColor: "rgba(218,216,216,1)",
                borderRadius: 30,
                height: 60,
              }}
            >
              <MaterialCommunityIcons
                name="car"
                size={32}
                color="rgba(74,74,74,1)"
              />
            </View>
            <TextInput
              placeholder="Enter Address"
              style={{ width: "80%" }}
              inputStyle={{ backgroundColor: "rgba(243,243,243,1)" }}
              value={address}
              onChangeText={(val) => setAddress(val)}
            />
            <GooglePlacesAutocomplete
              placeholder="Enter Address"
              fetchDetails={true}
              onPress={(data, details) => {
                setAddress(details);
              }}
              query={{
                key: GOOGLE_API_KEY,
                language: "en",
              }}
              textInputProps={{
                style: {
                  minHeight: 40,
                  width: '80%',
                  padding: 10,
                  fontSize: 15,
                  borderWidth: 2,
                  borderRadius: 6,
                },
              }}
              onFail={(error) => console.error(error)}
              requestUrl={{
                useOnPlatform: "web", // or "all"
                url: "https://cors-anywhere.herokuapp.com/https://maps.googleapis.com/maps/api", // or any proxy server that hits https://maps.googleapis.com/maps/api
                // headers: {
                //   Authorization: `an auth token`, // if required for your proxy
                // },
              }}
              minLength={4}
              listViewDisplayed="auto"
              nearbyPlacesAPI="GooglePlacesSearch"
              debounce={200}
              renderRow={(rowData) => {
                const title = rowData.structured_formatting.main_text;
                const address = rowData.structured_formatting.secondary_text;
                return (
                  <View style={{ width: '80%' }}>
                    <Text style={{ fontSize: 14 }}>{title}</Text>
                    <Text style={{ fontSize: 14 }}>{address}</Text>
                  </View>
                );
              }}
              styles={{
                container: {
                  width: "80%",
                  height: "40%",
                },
                textInputContainer: {
                  flexDirection: "row",
                },
                textInput: {
                  backgroundColor: "#FFFFFF",
                  height: 44,
                  borderRadius: 5,
                  paddingVertical: 5,
                  paddingHorizontal: 10,
                  fontSize: 15,
                  width: "80%",
                },
                poweredContainer: {
                  justifyContent: "flex-end",
                  alignItems: "center",
                  borderBottomRightRadius: 5,
                  borderBottomLeftRadius: 5,
                  borderColor: "#c8c7cc",
                  borderTopWidth: 0.5,
                },
                powered: {},
                listView: {},
                row: {
                  backgroundColor: "#FFFFFF",
                  padding: 13,
                  height: 44,
                  flexDirection: "row",
                },
                separator: {
                  height: 0.5,
                  backgroundColor: "#c8c7cc",
                  marginTop: 10,
                  marginBottom: 10,
                },
                description: {},
                loader: {
                  flexDirection: "row",
                  justifyContent: "flex-end",
                  height: 20,
                },
              }}
            />
          </View>
        )}
        <View style={{ flexDirection: "row", alignItems: "center" }}>
          <Text style={{ fontWeight: "400", marginRight: 20, marginLeft: 30 }}>
            Delivery Included?
          </Text>
          <Switch
            value={deliveryChecked}
            onValueChange={() => {
              setDeliveryChecked(!deliveryChecked);
            }}
          />
        </View>
        <Button
          title="Order"
          // onPress={GetTrans}
          onPress={() => {
            setDeliveryModal(false);
            setOngoingDelivery(true);
          }}
          contentContainerStyle={styles.btn}
          style={{ margin: 25 }}
        />
        <Button
          title="Cancel"
          onPress={() => {
            setDeliveryModal(false);
            setOngoingDelivery(null);
            setName(null);
            setPhone(null);
            setAddress(null);
          }}
          contentContainerStyle={styles.btn}
          style={{ margin: 25 }}
        />
      </View>
    </View>
  );
};

export default DeliveryScreen;

const styles = StyleSheet.create({
  sizeRow: {
    flexDirection: "row",
    alignItems: "center",
    justifyContent: "space-between",
    marginBottom: 25,
  },
  halfRow: {
    flexDirection: "row",
    alignItems: "center",
    justifyContent: "space-between",
    width: "50%",
  },
  toppingsContainer: {
    flex: 1,
    flexDirection: "row",
    flexWrap: "wrap",
    justifyContent: "space-between",
    marginBottom: 25,
    marginTop: 25,
  },
  touchable: {
    margin: 25,
    width: 300,
  },
  modalContainer: {
    padding: 50,
    backgroundColor: "rgba(255,255,255,1)",
    borderRadius: 30,
    shadowColor: "rgba(0,0,0,1)",
    shadowOffset: {
      width: 3,
      height: 3,
    },
    elevation: 30,
    shadowOpacity: 0.57,
    shadowRadius: 10,
    width: "35%",
  },
  btn: {
    height: 40,
    justifyContent: "center",
    alignItems: "center",
  },
  input: {
    marginTop: 25,
    marginBottom: 25,
  },
});
